// ==UserScript==
// @name           SCP-106 Old Emergence Image
// @description    It had to be removed from the SCP Wiki because of copyright and some people won't stop complaining.
// @author         QSKSw
// @version        0.1

// @namespace       http://QSKSw.github.io/tampermonkey/scp106.user.js

// @match          htt*://www.scp-wiki.net/scp-106*
// @match          htt*://scp-wiki.wikidot.com/scp-106*

// ==/UserScript==

window.addEventListener('load', function() {
var images = document.getElementsByTagName('img');
for (var i = 0; i < images.length; i++)
{
images[i].src = images[i].src.replace('http://scp-wiki.wdfiles.com/local--files/scp-106/106emergenceklay.jpg', 'data:image/jpeg;base64,');
images[i].style = images[i].style.width.replace('400px', '250px');
}}, false);

window.addEventListener('load', function() {
var els = document.getElementsByTagName("*");
for(var i = 0, l = els.length; i < l; i++) {
  var el = els[i];
  el.innerHTML = el.innerHTML.replace(/400px/gi, '250px');
}}, false);